import React from 'react';

function BreadCollection() {
    return (
        <div>
            <h2>Bread collections of recipes</h2>
            <h3>Background image with link</h3>
            <h4>Title</h4>
            <p>Descriptions text</p>
        </div>
    );
}

export default BreadCollection;
